import React from 'react';
import './index.css';
import { NavLink } from 'react-router-dom';

function Header() {

    return (
        <div className="Header">
            <div className="logoContainer">
                <div> logo </div>
            </div>
            <div className="linkContainer">
                <NavLink 
                    to="/"
                    className={({ isActive }) =>
                        isActive ? "link-active" : "link-inactive"
                    }
                >Home</NavLink>

            </div>
        </div>
    );
}

export default Header;
